. This is a simple DNS server that does not handle any errors, and does not implement any of the DNS protocol specifics, it just does a simple forward to the specified dns servers.

```go
package main

import (
	"fmt"
	"net"
	"sync"
)

var (
	dnsServers = []string{"8.8.8.8", "1.1.1.1"}
	resolvedIPs = make(map[string]string)
	mu          sync.Mutex
)

func main() {
	l, err := net.Listen("udp", ":53")
	if err != nil {
		fmt.Println(err)
		return
	}
	defer l.Close()

	for {
		conn, err := l.Accept()
		if err != nil {
			fmt.Println(err)
			continue
		}
		go handleRequest(conn)
	}
}

func handleRequest(conn net.Conn) {
	defer conn.Close()

	buf := make([]byte, 1024)
	n, err := conn.Read(buf)
	if err != nil {
		return
	}

	hostname := string(buf[:n])
	resolvedIP := resolve(hostname)
	mu.Lock()
	resolvedIPs[hostname] = resolvedIP
	mu.Unlock()

	buf = []byte(resolvedIP)
	_, err = conn.Write(buf)
	if err != nil {
		return
	}
}

func resolve(hostname string) string {
	for _, server := range dnsServers {
		conn, err := net.Dial("udp", server+":53")
		if err != nil {
			continue
		}
		defer conn.Close()

		buf := []byte(hostname)
		_, err = conn.Write(buf)
		if err != nil {
			continue
		}

		buf = make([]byte, 1024)
		n, err := conn.Read(buf)
		if err != nil {
			continue
		}

		return string(buf[:n])
	}
	return ""
}
```

